INSERT INTO `c_dokumen_informasi` VALUES (131, NULL, 5, 'Dokumen Rencana Pembangunan Jangka Pajang (RPJP) Daerah Kota Tangerang ', 'Rencana Pembangunan Jangka Panjang Daerah (disingkat RPJP Daerah) adalah dokumen perencanaan pembangunan daerah untuk periode 20 (dua puluh). RPJP Nasional untuk tahun 2005 sampai dengan 2025 diatur dalam Undang-Undang Nomor 17 Tahun 2007. RPJP Daerah yang memuat visi, misi, dan arah Pembangunan Jangka Panjang Daerah disusun mengacu kepada RPJP Nasional. \r\n\r\n\r\n\r\n', 82, '2020-07-22 10:51:38', NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL);
