INSERT INTO `c_dokumen_informasi` VALUES (133, NULL, 5, 'Dokumen Rencana Pembangunan Jangka Menengah (RPJM) Daerah Kota Tangerang', 'Rencana Pembangunan Jangka Menengah Daerah, (disingkat RPJM Daerah) adalah dokumen perencanaan pembangunan daerah untuk perioda 5 (lima) tahunan yang merupakan penjabaran dari visi, misi, dan program kepala daerah dengan berpedoman pada RPJP Daerah serta memerhatikan RPJM Nasional. \r\n\r\n', 82, '2020-07-22 10:59:06', NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL);
