INSERT INTO `c_dokumen_informasi` VALUES (876, NULL, 1, 'Laporan Layanan Informasi dan Dokumentasi (LLID)', 'Laporan Layanan Informasi dan Dokumentasi yang selanjutnya disingkat LLID adalah laporan yang berisi gambaran umum kebijakan teknis informasi dan dokumentasi, pelaksanaan pelayanan informasi dan dokumentasi, dan rekomendasi serta rencana tindak lanjut untuk meningkatkan kualitas pelayanan informasi dan dokumentasi.\r\n\r\nBerikut adalah  Ringkasan LLID Pemerintah Kota Tangerang, dimana data lengkap dalam bentuk laporan tersedia di PPID Pemerintah Kota Tanegrang .\r\n\r\n', 82, '2020-08-03 10:35:00', NULL, NULL, 2017, './assets/dokumen/upload/2020/08/03/3e7c81598d625f9d2801ebe0f963a1fa.pdf', '1', 1, NULL, 'file');
INSERT INTO `c_dokumen_informasi` VALUES (877, NULL, 1, 'Laporan Layanan Informasi dan Dokumentasi (LLID)', 'Laporan Layanan Informasi dan Dokumentasi yang selanjutnya disingkat LLID adalah laporan yang berisi gambaran umum kebijakan teknis informasi dan dokumentasi, pelaksanaan pelayanan informasi dan dokumentasi, dan rekomendasi serta rencana tindak lanjut untuk meningkatkan kualitas pelayanan informasi dan dokumentasi.\r\n\r\nBerikut adalah  Ringkasan LLID Pemerintah Kota Tangerang, dimana data lengkap dalam bentuk laporan tersedia di PPID Pemerintah Kota Tanegrang .\r\n', 82, '2020-08-03 10:35:48', NULL, NULL, NULL, NULL, '0', 1, NULL, '');
