INSERT INTO `c_dokumen_informasi` VALUES (900, NULL, 2, 'Layanan Informasi Publik Pemerintah Kota Tangerang', 'informasi mengenai pelayanan informasi publik di lingkup Pemerintah Kota Tangerang. Pelajari pula  tata cara dan mekanisme permohonan informasi, pengajuan keberatan dan sengketa informasi. ', 82, '2020-08-05 10:14:48', NULL, NULL, NULL, NULL, '0', 1, 'https://ppid.tangerangkota.go.id/layanan', 'link');
INSERT INTO `c_dokumen_informasi` VALUES (901, NULL, 2, 'Formulir', 'Berikut Formulir Permohonan dan Formulir Pengajuan Sengketa Informasi Publik yang merupakan syarat pengajuan Permohonan Informasi dan Pengajuan Sengketa Informasi Publik. ', 82, '2020-08-05 10:15:55', NULL, NULL, NULL, NULL, '0', 2, NULL, '');
INSERT INTO `c_dokumen_informasi` VALUES (902, 901, 2, 'Formulir Permohonan Informasi Publik ', 'Unduh Formulir Permohonan Informasi Publik sebagai syarat Permohonan Informasi Publik dan Jangan lupa sertakan dokumen data diri pemohon perorangan/ kelompok. ', 82, '2020-08-05 10:18:35', NULL, NULL, NULL, './assets/dokumen/upload/2020/08/05/55e6dc5c4175a1f823a5f7c64c6cc959.pdf', '0', 1, NULL, 'file');
INSERT INTO `c_dokumen_informasi` VALUES (903, 901, 2, 'Formulir Pengajuan Keberatan Informasi ', 'Unduh Formulir Pengajuan Keberatan Informasi sebagai syarat Pengajuan Keberatan Informasi. Informasi tata cara dan mekanisme pangajuan keberatan dapat dilihat di bagian Layanan Informasi Publik pada situs PPID', 82, '2020-08-05 10:20:44', NULL, NULL, NULL, './assets/dokumen/upload/2020/08/05/5a2a99885bb90d606127f04b11f2b5f6.pdf', '0', 2, NULL, 'file');
