INSERT INTO `c_dokumen_informasi` VALUES (905, 901, 2, 'Formulir Permohonan Informasi Publik Online', 'Akses tautan berikut untuk langsung mengisi Formulir Permohonan Informasi Publik sebagai syarat Permohonan Informasi Publik. Catatan: siapkan terlebih dahulu salinan digital data pendukung  seperti dokumen data diri pemohon perorangan/ kelompok untuk diunggah pada laman Formulir. ', 82, '2020-08-05 10:23:54', NULL, NULL, NULL, NULL, '0', 3, 'https://ppid.tangerangkota.go.id/permohonan', 'link');
