INSERT INTO `c_dokumen_informasi` VALUES (907, NULL, 3, 'Laporan Akses Informasi Publik ', 'Informasi mengenai jumlah permohonan informasi publik yang diterima oleh PPID Utama dan PPID Pembantu, termasuk  jumlah permohonan informasi publik yang di kabulkan baik sebagian atau seluruhnya dan permohonan informasi publik yang di tolak  dan alasan penolakan permohonan informasi publik \r\n', 82, '2020-08-05 10:26:41', NULL, NULL, NULL, NULL, '0', 1, NULL, '');
