INSERT INTO `c_dokumen_informasi` VALUES (914, NULL, 11, 'Laporan Penyelenggaraan Pemerintahan Daerah (ILPPD)', 'Dokumen Informasi Laporan Penyelenggaraan Pemerintahan Daerah (ILPPD) adalah informasi atas penyelenggaraan pemerintahan daerah yang disampaikan oleh Kepala Daerah kepada masyarakat melalui media yang tersedia di daerah.\r\n\r\n', 82, '2020-08-05 10:32:58', NULL, NULL, NULL, NULL, '0', 1, NULL, '');
INSERT INTO `c_dokumen_informasi` VALUES (915, NULL, 11, 'Laporan Kinerja Instansi Pemerintahan (LKIP ) ', 'Dokumen Laporan Kinerja Instansi Pemerintahan (LKIP ) merupakan produk akhir SAKIP yang menggambarkan kinerja yang dicapai oleh suatu instansi pemerintah atas pelaksanaan program dan kegiatan yang dibiayai APBN/APBD. Penyusunan LKIP berdasarkan siklus anggraan yang berjalan 1 tahu', 82, '2020-08-05 10:35:44', NULL, NULL, NULL, NULL, '0', 2, NULL, '');
INSERT INTO `c_dokumen_informasi` VALUES (916, NULL, 11, 'Laporan Keterangan Pertanggungjawaban Kepala Daerah (LKPJ)', 'Dokumen Laporan Keterangan Pertanggungjawaban Kepala Daerah kepada DPRD yang selanjutnya disebut LKPJ adalah laporan yang berupa informasi penyelenggaraan pemerintahan daerah selama 1 (satu) tahun anggaran atau akhir masa jabatan yang disampaikan oleh kepala daerah kepada DPRD. \r\n\r\n', 82, '2020-08-05 10:36:24', NULL, NULL, NULL, NULL, '0', 2, NULL, '');
